import React from "react";
const Reg = () => {
  return (
    <>
      <h1>Registation</h1>
      <input class="mr-2" type="text" placeholder="Enter Username"></input>
      <br />
      <input type="password" placeholder="Enter password"></input>
      <br />
      <button className="btn btn-outline bg-danger">Submit</button>
    </>
  );
};
export default Reg;
